import FullCalendar from "@fullcalendar/react";
import timeGridPlugin from "@fullcalendar/timegrid";
import { useState } from "react";
import { API } from "../../util/api/Api.js";
import "./home.css";
import moment from "moment";

let api = new API();

function Home(props) {
  const [cronDetails, setCronDetails] = useState([]);

  const clearEvents = () => {
    setCronDetails([]);
  };

  const getStartTime = (time) => {
    return moment(time).local().format("YYYY-MM-DDTkk:mm:ss");
  };

  const getEndTime = (time) => {
    const dateTime = new Date(time);
    dateTime.setSeconds(dateTime.getSeconds() + 1);
    return moment(dateTime).local().format("YYYY-MM-DDTkk:mm:ss");
  };

  const handleReloadClick = () => {
    return new Promise((resolve) => {
      api
        .getTriggerTimes()
        .then((res) => {
          clearEvents();
          var startTimeMap = [];
          console.log(res.data.message);

          res.data.message.forEach((element) => {
            console.log("hello");
            var {
              name,
              clientName,
              timeZone,
              cron,
              cronInfo,
              env,
              exchange,
              reportCycle,
              createdTs,
              triggerTimes,
            } = element;
            triggerTimes = ["1", "2", "3"];
            triggerTimes.forEach((element) => {
              startTimeMap.push({
                [element]: {
                  name: name,
                  clientName: clientName,
                  timeZone: timeZone,
                  cron: cron,
                  cronInfo: cronInfo,
                  env: env,
                  exchange: exchange,
                  reportCycle: reportCycle,
                  createdTs: createdTs,
                },
              });
              console.log("hello1",Object.values(startTimeMap)["1"]);
            });
          });
        })
        .catch((err) => {
          console.log(err);
        });
    });
  };

  return (
    <div>
      <div>
        <FullCalendar
          plugins={[timeGridPlugin]}
          timeZone="local"
          initialView="timeGridDay"
          allDaySlot={false}
          eventMinHeight={20}
          customButtons={{
            reload: {
              text: "Reload",
              click: function () {
                handleReloadClick();
              },
            },
          }}
          headerToolbar={{
            left: "reload,prev,next",
            right: "today,timeGridDay,timeGridWeek",
          }}
          eventClick={function (arg) {
            alert(arg.event.title);
            alert(arg.event.start);
          }}
          slotDuration="00:05:00"
          //events={events}
        />
      </div>
    </div>
  );
}

export default Home;
